import React from 'react';

const Article = (props) => {
    let text = "";
    if (props.isPublish ){
        text = "公開";
    }else{
        text = "非公開";
    }
    return(
        <>
            <h2>{props.title}コンポーネント練習</h2>
            <h2>{props.id}</h2>
            <h2>{props.name}</h2>
            <h2>{text}</h2>
        </>
    )
};

export default Article
